import re

def extract_gif_links(input_string):
    # Regular expression to match URLs that end with .gif
    url_pattern = r'https?://[^\s"<>]+\.gif|www\.[^\s"<>]+\.gif'
    
    # Find all matches in the input string
    gif_links = re.findall(url_pattern, input_string)
    
    # Remove duplicates by converting the list to a set
    unique_gif_links = set(gif_links)
    
    # Generate HTML for each unique gif link
    html_output = ""
    for i, link in enumerate(sorted(unique_gif_links), start=1):
        html_output += f'''
        <div class="gallery-item">
            <img src="{link}" alt="Photo {i}">
        </div>
        '''
    
    return html_output

